        moves++;

        if (command == "bullseye") {
            break;
        }

        cin >> points;
        cin.ignore();

        if (command == "double ring") {
            points *= 2;
        }
        else if (command == "triple ring") {
            points *= 3;
        }

        startPoints -= points;
    }

    if (startPoints == 0) {
        cout << "Congratulations! You won the game in " << moves << " moves!\n";
    }
    else if (startPoints < 0) {
        cout << "Sorry, you lost. Score difference: " << abs(startPoints) << ".\n";
    }
