#include <stdio.h>
#include <stdlib.h>
#include <assert.h>
#define NMAX 101

void insSort(int n, int arr[]) {
	for (int i = 1; i < n; i++) {
		int key = arr[i], j;
		for (j = i - 1; j >= 0 && arr[j] >= key; j--) {
			arr[j + 1] = arr[j];
		}
		arr[j + 1] = key;
	}
}

int main(void) {
	int n;
	assert(scanf_s("%d", &n));
	static int arr[NMAX];
	for (int i = 0; i < n; i++) {
		assert(scanf_s("%d", &arr[i]));
	}
	insSort(n, arr);
	for (int i = 0; i < n; i++) {
		printf("%d ", arr[i]);
	}
	putchar('\n');
	return 0;
}

